import httpClient from "../http-common2";

// const create = (data) => {
//   return httpClient.post("/security/user/b/i", data);
// };

const getAll = () => {
  return httpClient.get("/bookingdetails/g");
};

const update = (id) => {
  return httpClient.put("/bookindetails/u/$id", id);
};
const create = (data) => {
  return httpClient.post("/security/user/b/i", data);
};
export default { create, getAll ,update};
